new Offer { OfferID = 1049, FreelancerID = 181, JobID = 497, DateOffer = DateTime.ParseExact("2023-08-04 01:27", "yyyy-MM-dd HH:mm", CultureInfo.InvariantCulture), ProposedCost = 48409035, ExpectedDays = 8, SelfIntroduction = "Xin chào, tôi là Hoàng Thị K. Tôi đến từ Đồng Nai và là một lập trình viên Full-Stack. Tôi có kinh nghiệm trong việc phát triển các ứng dụng web đa dạng và linh hoạt. Angular, Java và Spring Boot là những công cụ mà tôi thường sử dụng để xây dựng các dự án của mình.", EstimatedPlan = "Tôi cam kết tạo ra một sản phẩm có thể tương tác và kết nối với các dịch vụ và nền tảng khác, tạo ra một hệ sinh thái ứng dụng phong phú và linh hoạt." },
