new Offer { OfferID = 1370, FreelancerID = 11, JobID = 518, DateOffer = DateTime.ParseExact("2024-04-11 16:05", "yyyy-MM-dd HH:mm", CultureInfo.InvariantCulture), ProposedCost = 4977343, ExpectedDays = 26, SelfIntroduction = "Kỹ năng tổ chức và quản lý thời gian của tôi giúp tôi hoàn thành các dự án đúng hạn và đảm bảo hiệu suất làm việc cao nhất.", EstimatedPlan = "Tính kiên nhẫn và kiên trì của tôi giúp tôi vượt qua các thách thức trong quá trình phát triển và đảm bảo rằng mọi công việc được hoàn thành một cách xuất sắc." },
