new Offer { OfferID = 1372, FreelancerID = 11, JobID = 520, DateOffer = DateTime.ParseExact("2024-04-12 16:05", "yyyy-MM-dd HH:mm", CultureInfo.InvariantCulture), ProposedCost = 8022277, ExpectedDays = 29, SelfIntroduction = "Khả năng làm việc trực tuyến là một trong những điểm mạnh của tôi. Tôi đã có kinh nghiệm làm việc từ xa trên nhiều dự án, từ việc cộng tác với đội ngũ phát triển đa quốc gia đến việc hợp tác với khách hàng và đối tác trên khắp thế giới. Tôi có khả năng sử dụng các công cụ hợp tác trực tuyến như Slack, Zoom, và Trello một cách linh hoạt và hiệu quả, đảm bảo thông tin được truyền đạt một cách nhanh chóng và rõ ràng", EstimatedPlan = "Tôi cam kết mang đến các sản phẩm có chất lượng cao và đảm bảo an ninh thông tin để bảo vệ dữ liệu của người dùng." },
new Offer { OfferID = 1373, FreelancerID = 11, JobID = 521, DateOffer = DateTime.ParseExact("2024-04-12 16:05", "yyyy-MM-dd HH:mm", CultureInfo.InvariantCulture), ProposedCost = 4597297, ExpectedDays = 31, SelfIntroduction = "Tôi hiểu rõ tính quan trọng của việc duy trì sự kết nối và giao tiếp trong môi trường làm việc trực tuyến. Tôi luôn sẵn lòng thảo luận, trao đổi ý kiến và cùng nhau tìm ra giải pháp thông qua các cuộc họp trực tuyến và thảo luận nhóm, giúp tạo ra một môi trường làm việc tích cực và hiệu quả.", EstimatedPlan = "Khả năng làm việc trực tuyến là một trong những điểm mạnh của tôi. Tôi đã có kinh nghiệm làm việc từ xa trên nhiều dự án, từ việc cộng tác với đội ngũ phát triển đa quốc gia đến việc hợp tác với khách hàng và đối tác trên khắp thế giới. Tôi có khả năng sử dụng các công cụ hợp tác trực tuyến như Slack, Zoom, và Trello một cách linh hoạt và hiệu quả, đảm bảo thông tin được truyền đạt một cách nhanh chóng và rõ ràng" },
new Offer { OfferID = 1374, FreelancerID = 11, JobID = 522, DateOffer = DateTime.ParseExact("2024-04-13 16:05", "yyyy-MM-dd HH:mm", CultureInfo.InvariantCulture), ProposedCost = 9034729, ExpectedDays = 36, SelfIntroduction = "Tôi có khả năng tự quản lý thời gian và làm việc độc lập một cách hiệu quả khi làm việc từ xa. Tôi luôn tuân thủ theo lịch trình làm việc được xác định và tự đặt mục tiêu cụ thể cho bản thân, đồng thời luôn sẵn lòng thích nghi với các thay đổi và yêu cầu mới trong quá trình làm việc.", EstimatedPlan = "Tôi hiểu rõ tính quan trọng của việc duy trì sự kết nối và giao tiếp trong môi trường làm việc trực tuyến. Tôi luôn sẵn lòng thảo luận, trao đổi ý kiến và cùng nhau tìm ra giải pháp thông qua các cuộc họp trực tuyến và thảo luận nhóm, giúp tạo ra một môi trường làm việc tích cực và hiệu quả." },
new Offer { OfferID = 1375, FreelancerID = 11, JobID = 523, DateOffer = DateTime.ParseExact("2024-04-11 16:05", "yyyy-MM-dd HH:mm", CultureInfo.InvariantCulture), ProposedCost = 7204085, ExpectedDays = 31, SelfIntroduction = "Sự linh hoạt là một trong những ưu điểm của việc làm việc trực tuyến, và tôi tự tin rằng tôi có khả năng thích ứng với các môi trường làm việc đa dạng. Tôi có thể làm việc từ bất kỳ đâu, vào bất kỳ thời điểm nào và vẫn đảm bảo chất lượng và hiệu suất làm việc.", EstimatedPlan = "Tôi có khả năng tự quản lý thời gian và làm việc độc lập một cách hiệu quả khi làm việc từ xa. Tôi luôn tuân thủ theo lịch trình làm việc được xác định và tự đặt mục tiêu cụ thể cho bản thân, đồng thời luôn sẵn lòng thích nghi với các thay đổi và yêu cầu mới trong quá trình làm việc." },
new Offer { OfferID = 1376, FreelancerID = 12, JobID = 504, DateOffer = DateTime.ParseExact("2024-04-11 16:05", "yyyy-MM-dd HH:mm", CultureInfo.InvariantCulture), ProposedCost = 8183631, ExpectedDays = 26, SelfIntroduction = "Tôi đã xây dựng một mạng lưới liên kết và kỹ năng giao tiếp trực tuyến mạnh mẽ thông qua việc tham gia vào các cộng đồng lập trình trực tuyến, như các diễn đàn, nhóm Facebook, và Discord. Điều này giúp tôi tiếp cận nguồn thông tin mới, chia sẻ kiến thức và kinh nghiệm, cũng như tạo ra cơ hội hợp tác và làm việc cùng những người đồng nghiệp trên khắp thế giới.", EstimatedPlan = "Sự linh hoạt là một trong những ưu điểm của việc làm việc trực tuyến, và tôi tự tin rằng tôi có khả năng thích ứng với các môi trường làm việc đa dạng. Tôi có thể làm việc từ bất kỳ đâu, vào bất kỳ thời điểm nào và vẫn đảm bảo chất lượng và hiệu suất làm việc." },
new Offer { OfferID = 1377, FreelancerID = 12, JobID = 505, DateOffer = DateTime.ParseExact("2024-04-12 16:05", "yyyy-MM-dd HH:mm", CultureInfo.InvariantCulture), ProposedCost = 10985640, ExpectedDays = 21, SelfIntroduction = "Tôi tin rằng việc làm việc trực tuyến không chỉ là một xu hướng mà còn là một cơ hội để tăng cường sự linh hoạt và hiệu quả trong công việc. Tôi luôn sẵn lòng tìm kiếm cách để tận dụng các công nghệ và công cụ mới nhằm tối ưu hóa quá trình làm việc và tạo ra giá trị cho doanh nghiệp.", EstimatedPlan = "Tôi đã xây dựng một mạng lưới liên kết và kỹ năng giao tiếp trực tuyến mạnh mẽ thông qua việc tham gia vào các cộng đồng lập trình trực tuyến, như các diễn đàn, nhóm Facebook, và Discord. Điều này giúp tôi tiếp cận nguồn thông tin mới, chia sẻ kiến thức và kinh nghiệm, cũng như tạo ra cơ hội hợp tác và làm việc cùng những người đồng nghiệp trên khắp thế giới." },
